import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import under_navbarfx from './under_navbar';


const root = ReactDOM.createRoot(document.getElementById('root'));
const under_root = ReactDOM.createRoot(document.getElementById('under_root'));

root.render(
    <App />
);

under_root.under_navbarfx(
    <under_navbarfx/>
);
